-- Flyway Migration Script V1 (versão com constraints inline)

create database if not exists `bicity`;

use `bicity`;

create table if not exists `configuracao_api_externa` (
    `id` bigint primary key auto_increment,
    `nome` varchar(255) unique not null,
    `url` varchar(255) not null,
    `chave` varchar(255),
    `dt_atualizacao` timestamp default (now())
);

create table if not exists `nivel_habilidade` (
    `id` bigint primary key auto_increment,
    `nome` varchar(255) not null,
    `descricao` varchar(255) not null
);

create table if not exists `usuario` (
    `id` bigint primary key auto_increment,
    `nome` varchar(255) not null,
    `nome_usuario` varchar(255) unique not null,
    `endereco` varchar(255) not null,
    `e-mail` varchar(255) unique not null,
    `role` varchar(255) not null,
    `senha` varchar(255) not null,
    `hash` varchar(255) not null,
    `dt_criacao` timestamp default (now()),
    `cpf` varchar(255),
    `cnpj` varchar(255),
    `id_nivel_habilidade` bigint,
    `foto` blob,
    constraint `fk_nivel_habilidade` foreign key (`id_nivel_habilidade`) references `nivel_habilidade`(`id`)
);

create table if not exists `sessao` (
    `id` bigint primary key auto_increment,
    `id_usuario` bigint not null unique,
    `token` blob,
    constraint `fk_usuario_sessao` foreign key (`id_usuario`) references `usuario`(`id`)
);

create table if not exists `token` (
    `id` bigint primary key auto_increment,
    `valor` varchar(255) unique not null,
    `dt_criacao` timestamp default (now()),
    `dt_expiracao` timestamp not null,
    `email` varchar(255) not null
);

create table if not exists `tipo_evento` (
    `id` bigint primary key auto_increment,
    `nome` varchar(255) not null,
    `id_nivel_habilidade` bigint not null,
    constraint `fk_nivel_habilidade_tipo_evento` foreign key (`id_nivel_habilidade`) references `nivel_habilidade`(`id`)
);

create table if not exists `evento` (
    `id` bigint primary key auto_increment,
    `nome` varchar(255) not null,
    `descricao` varchar(255) not null,
    `data` timestamp not null,
    `dt_atualizacao` timestamp,
    `endereco` varchar(255) not null,
    `faixa_km` bigint not null,
    `gratuito` boolean not null,
    `id_tipo_evento` bigint not null,
    `id_usuario` bigint not null,
    `aprovado` boolean not null default false,
    `foto` blob,
    constraint `fk_tipo_evento` foreign key (`id_tipo_evento`) references `tipo_evento`(`id`),
    constraint `fk_usuario_evento` foreign key (`id_usuario`) references `usuario`(`id`)
);

create table if not exists `tipo_infraestrutura_cicloviaria` (
    `id` bigint primary key auto_increment,
    `nome` varchar(255) not null,
    `descricao` varchar(255) not null
);

create table if not exists `infraestrutura_cicloviaria` (
    `id` bigint primary key auto_increment,
    `json_id` varchar(255) not null,
    `nome_localidade` varchar(255),
    `nota_media` int not null,
    `geometria` varchar(255) not null,
    `id_tipo_infraestrutura_cicloviaria` bigint not null,
    `foto` blob,
    constraint `fk_tipo_infraestrutura_cicloviaria` foreign key (`id_tipo_infraestrutura_cicloviaria`) references `tipo_infraestrutura_cicloviaria`(`id`)
);

create table if not exists `trecho` (
    `id` bigint primary key auto_increment,
    `latitude` varchar(255) not null,
    `longitude` varchar(255) not null,
    `id_infraestrutura_cicloviaria` bigint not null,
    constraint `fk_infraestrutura_cicloviaria` foreign key (`id_infraestrutura_cicloviaria`) references `infraestrutura_cicloviaria`(`id`)
);

create table if not exists `avaliacao_infraestrutura_cicloviaria` (
    `id` bigint primary key auto_increment,
    `id_usuario` bigint not null,
    `id_infraestrutura_cicloviaria` bigint not null,
    `nota` int not null,
    `comentario` varchar(255),
    `dt_criacao` timestamp default (now()),
    constraint `fk_usuario_avaliacao` foreign key (`id_usuario`) references `usuario`(`id`),
    constraint `fk_infraestrutura_avaliacao` foreign key (`id_infraestrutura_cicloviaria`) references `infraestrutura_cicloviaria`(`id`)
);

create table if not exists `problema` (
    `id` bigint primary key auto_increment,
    `descricao` varchar(255) not null,
    `foto` blob,
    `dt_criacao` timestamp default (now()),
    `validado` boolean not null,
    `ativo` boolean not null,
    `id_trecho` bigint not null,
    constraint `fk_trecho_problema` foreign key (`id_trecho`) references `trecho`(`id`)
);

